// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./DeFiScoreRegistry.sol";

/**
 * @title LenderIntegration
 * @notice Example lender contract integrating DeFi credit scores
 * @dev Demonstrates how lending protocols can use the score registry
 * 
 * Features:
 * - Per-lender threshold configuration
 * - Automatic credit score verification
 * - Borrow limit management
 * - Proof freshness enforcement
 * 
 * Integration Pattern:
 * 1. Lender sets threshold via setThreshold()
 * 2. User submits ZK proof to DeFiScoreRegistry
 * 3. User calls borrow() - automatic eligibility check
 * 4. Lender can query eligibility anytime via checkEligibility()
 */
contract LenderIntegration {
    
    // ============================================================================
    // STATE VARIABLES
    // ============================================================================
    
    /// @notice Reference to DeFiScoreRegistry
    DeFiScoreRegistry public immutable scoreRegistry;
    
    /// @notice Minimum credit score required for borrowing (scaled x1000)
    uint256 public borrowThreshold;
    
    /// @notice Contract owner
    address public owner;
    
    /// @notice Mapping of user to borrow limit (in wei)
    mapping(address => uint256) public borrowLimits;
    
    /// @notice Mapping of user to current borrowed amount
    mapping(address => uint256) public borrowed;
    
    // ============================================================================
    // EVENTS
    // ============================================================================
    
    event ThresholdUpdated(uint256 oldThreshold, uint256 newThreshold);
    event BorrowLimitSet(address indexed user, uint256 limit);
    event Borrowed(address indexed user, uint256 amount);
    event Repaid(address indexed user, uint256 amount);
    
    // ============================================================================
    // ERRORS
    // ============================================================================
    
    error Unauthorized();
    error InsufficientCreditScore(uint256 required, uint256 actual);
    error CreditScoreExpired();
    error NoCreditScore();
    error ExceedsBorrowLimit();
    error NothingToBorrow();
    error NothingToRepay();
    
    // ============================================================================
    // MODIFIERS
    // ============================================================================
    
    modifier onlyOwner() {
        if (msg.sender != owner) revert Unauthorized();
        _;
    }
    
    // ============================================================================
    // CONSTRUCTOR
    // ============================================================================
    
    /**
     * @param _scoreRegistry Address of DeFiScoreRegistry
     * @param _initialThreshold Initial credit score threshold
     */
    constructor(address _scoreRegistry, uint256 _initialThreshold) {
        scoreRegistry = DeFiScoreRegistry(_scoreRegistry);
        borrowThreshold = _initialThreshold;
        owner = msg.sender;
    }
    
    // ============================================================================
    // BORROWING FUNCTIONS
    // ============================================================================
    
    /**
     * @notice Borrow funds (requires valid credit score)
     * @param amount Amount to borrow
     */
    function borrow(uint256 amount) external {
        if (amount == 0) revert NothingToBorrow();
        
        // Check credit score eligibility
        _checkCreditScore(msg.sender);
        
        // Check borrow limit
        uint256 limit = borrowLimits[msg.sender];
        uint256 currentBorrowed = borrowed[msg.sender];
        
        if (currentBorrowed + amount > limit) {
            revert ExceedsBorrowLimit();
        }
        
        // Update borrowed amount
        borrowed[msg.sender] = currentBorrowed + amount;
        
        // Transfer funds (simplified - in production, use proper lending logic)
        payable(msg.sender).transfer(amount);
        
        emit Borrowed(msg.sender, amount);
    }
    
    /**
     * @notice Repay borrowed funds
     */
    function repay() external payable {
        if (msg.value == 0) revert NothingToRepay();
        
        uint256 currentBorrowed = borrowed[msg.sender];
        
        if (currentBorrowed == 0) revert NothingToRepay();
        
        // Update borrowed amount
        if (msg.value >= currentBorrowed) {
            borrowed[msg.sender] = 0;
            
            // Refund excess
            if (msg.value > currentBorrowed) {
                payable(msg.sender).transfer(msg.value - currentBorrowed);
            }
        } else {
            borrowed[msg.sender] = currentBorrowed - msg.value;
        }
        
        emit Repaid(msg.sender, msg.value);
    }
    
    /**
     * @notice Check if user is eligible to borrow
     * @param user User address
     * @return eligible True if user meets credit requirements
     * @return score User's credit score (scaled x1000)
     * @return availableLimit Remaining borrow capacity
     */
    function checkEligibility(address user) 
        external 
        view 
        returns (
            bool eligible,
            uint256 score,
            uint256 availableLimit
        ) 
    {
        // Check if user meets this lender's threshold
        bool meetsThreshold = scoreRegistry.meetsLenderThreshold(user, address(this));
        
        if (!meetsThreshold) {
            // Get score for informational purposes
            DeFiScoreRegistry.EligibilityData memory eligData = scoreRegistry.getEligibilityData(user);
            return (false, eligData.score, 0);
        }
        
        // Get user's score
        DeFiScoreRegistry.EligibilityData memory data = scoreRegistry.getEligibilityData(user);
        
        // Calculate available limit
        uint256 limit = borrowLimits[user];
        uint256 currentBorrowed = borrowed[user];
        uint256 available = limit > currentBorrowed ? limit - currentBorrowed : 0;
        
        return (true, data.score, available);
    }
    
    // ============================================================================
    // ADMIN FUNCTIONS
    // ============================================================================
    
    /**
     * @notice Update credit score threshold
     * @param newThreshold New minimum score (scaled x1000, 0-900000)
     */
    function setThreshold(uint256 newThreshold) external onlyOwner {
        require(newThreshold <= 900000, "Invalid threshold");
        
        uint256 oldThreshold = borrowThreshold;
        borrowThreshold = newThreshold;
        
        // Also update in registry for this lender
        scoreRegistry.setThreshold(newThreshold);
        
        emit ThresholdUpdated(oldThreshold, newThreshold);
    }
    
    /**
     * @notice Set borrow limit for user
     * @param user User address
     * @param limit Borrow limit in wei
     */
    function setBorrowLimit(address user, uint256 limit) external onlyOwner {
        borrowLimits[user] = limit;
        
        emit BorrowLimitSet(user, limit);
    }
    
    /**
     * @notice Batch set borrow limits
     * @param users Array of user addresses
     * @param limits Array of borrow limits
     */
    function setBorrowLimitsBatch(
        address[] calldata users,
        uint256[] calldata limits
    ) external onlyOwner {
        require(users.length == limits.length, "Length mismatch");
        
        for (uint256 i = 0; i < users.length; i++) {
            borrowLimits[users[i]] = limits[i];
            emit BorrowLimitSet(users[i], limits[i]);
        }
    }
    
    /**
     * @notice Withdraw contract balance (owner only)
     */
    function withdraw() external onlyOwner {
        payable(owner).transfer(address(this).balance);
    }
    
    /**
     * @notice Deposit funds to contract
     */
    receive() external payable {}
    
    // ============================================================================
    // INTERNAL FUNCTIONS
    // ============================================================================
    
    /**
     * @notice Internal function to check credit score
     * @param user User address
     */
    function _checkCreditScore(address user) internal view {
        // Check if user meets this lender's threshold
        bool meetsThreshold = scoreRegistry.meetsLenderThreshold(user, address(this));
        
        if (!meetsThreshold) {
            // Get detailed data for error message
            DeFiScoreRegistry.EligibilityData memory data = scoreRegistry.getEligibilityData(user);
            
            if (!data.isEligible) {
                revert NoCreditScore();
            }
            
            // Check if proof expired
            if (!scoreRegistry.isProofFresh(user)) {
                revert CreditScoreExpired();
            }
            
            // Score exists but doesn't meet threshold
            revert InsufficientCreditScore(borrowThreshold, data.score);
        }
    }
    
    /**
     * @notice Get time until user's proof expires
     * @param user User address
     * @return uint256 Seconds until expiry (0 if expired)
     */
    function getTimeUntilExpiry(address user) external view returns (uint256) {
        return scoreRegistry.getTimeUntilExpiry(user);
    }
    
    /**
     * @notice Check if user's proof is still fresh
     * @param user User address
     * @return bool Freshness status
     */
    function isProofFresh(address user) external view returns (bool) {
        return scoreRegistry.isProofFresh(user);
    }
}

contracts/LendingEscrow.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

interface IERC20 {
    function transferFrom(address from, address to, uint256 amount) external returns (bool);
    function transfer(address to, uint256 amount) external returns (bool);
}

interface IDeFiScoreRegistry {
    function isEligible(address _user) external view returns (bool);
    function meetsThreshold(address _user, uint256 _threshold) external view returns (bool);
    function isProofFresh(address _user) external view returns (bool);
}

/**
 * @title LendingEscrow
 * @notice Manages collateral locking and loan lifecycle for DeFiScore lending
 * @dev Handles collateral deposits, loan funding, repayments, and liquidations
 * 
 * INTEGRATION WITH ZK PROOF SYSTEM:
 * - Enforces credit score verification before loan creation
 * - Checks proof freshness (24-hour validity)
 * - Validates borrower meets lender's threshold
 * - Prevents loans without valid ZK proof
 */
contract LendingEscrow {
    
    // Owner
    address public owner;
    
    // DeFiScoreRegistry reference
    IDeFiScoreRegistry public scoreRegistry;
    
    // Minimum credit score threshold (scaled x1000, 0-900000)
    uint256 public defaultThreshold = 500000; // 500 score default
    
    // Reentrancy guard
    uint256 private locked = 1;
    
    modifier nonReentrant() {
        require(locked == 1, "Reentrant call");
        locked = 2;
        _;
        locked = 1;
    }
    
    modifier onlyOwner() {
        require(msg.sender == owner, "Not owner");
        _;
    }
    
    constructor() {
        owner = msg.sender;
    }
    
    enum LoanStatus {
        PENDING,        // Loan created, awaiting collateral
        COLLATERALIZED, // Collateral locked, awaiting funding
        ACTIVE,         // Loan funded and active
        REPAID,         // Loan fully repaid
        DEFAULTED,      // Loan defaulted, collateral claimable
        LIQUIDATED      // Collateral claimed by lender
    }
    
    struct Loan {
        bytes32 loanId;
        address borrower;
        address lender;
        address loanToken;          // Token being borrowed (e.g., USDC)
        address collateralToken;    // Token used as collateral (e.g., ETH)
        uint256 loanAmount;
        uint256 collateralAmount;
        uint256 interestRate;       // Basis points (e.g., 500 = 5%)
        uint256 durationDays;
        uint256 startTime;
        uint256 dueDate;
        uint256 totalRepayment;     // Principal + interest
        uint256 amountRepaid;
        LoanStatus status;
    }
    
    // Loan ID => Loan details
    mapping(bytes32 => Loan) public loans;
    
    // User => Loan IDs
    mapping(address => bytes32[]) public borrowerLoans;
    mapping(address => bytes32[]) public lenderLoans;
    
    // Events
    event LoanCreated(bytes32 indexed loanId, address indexed borrower, address indexed lender, uint256 loanAmount);
    event CollateralDeposited(bytes32 indexed loanId, address indexed borrower, uint256 collateralAmount);
    event LoanFunded(bytes32 indexed loanId, address indexed lender, uint256 loanAmount);
    event RepaymentMade(bytes32 indexed loanId, address indexed borrower, uint256 amount, uint256 remaining);
    event LoanRepaid(bytes32 indexed loanId, address indexed borrower);
    event CollateralReturned(bytes32 indexed loanId, address indexed borrower, uint256 collateralAmount);
    event LoanDefaulted(bytes32 indexed loanId, address indexed borrower);
    event CollateralLiquidated(bytes32 indexed loanId, address indexed lender, uint256 collateralAmount);
    event ScoreRegistryUpdated(address indexed newRegistry);
    event DefaultThresholdUpdated(uint256 newThreshold);
    
    // Errors
    error InsufficientCreditScore();
    error CreditScoreExpired();
    error NoCreditScoreProof();
    error ScoreRegistryNotSet();
    
    /**
     * @notice Create a new loan agreement
     * @param _loanId Unique loan identifier from backend
     * @param _borrower Borrower address
     * @param _lender Lender address
     * @param _loanToken Token to be borrowed
     * @param _collateralToken Token used as collateral
     * @param _loanAmount Amount to borrow
     * @param _collateralAmount Required collateral amount
     * @param _interestRate Interest rate in basis points
     * @param _durationDays Loan duration in days
     * 
     * SECURITY: Enforces credit score verification via ZK proof
     */
    function createLoan(
        bytes32 _loanId,
        address _borrower,
        address _lender,
        address _loanToken,
        address _collateralToken,
        uint256 _loanAmount,
        uint256 _collateralAmount,
        uint256 _interestRate,
        uint256 _durationDays
    ) external onlyOwner {
        require(loans[_loanId].loanId == bytes32(0), "Loan already exists");
        require(_borrower != address(0) && _lender != address(0), "Invalid addresses");
        require(_loanAmount > 0 && _collateralAmount > 0, "Invalid amounts");
        
        // CREDIT SCORE VERIFICATION
        _verifyCreditScore(_borrower);
        
        // Calculate total repayment (principal + interest)
        uint256 interest = (_loanAmount * _interestRate * _durationDays) / (10000 * 365);
        uint256 totalRepayment = _loanAmount + interest;
        
        Loan memory newLoan = Loan({
            loanId: _loanId,
            borrower: _borrower,
            lender: _lender,
            loanToken: _loanToken,
            collateralToken: _collateralToken,
            loanAmount: _loanAmount,
            collateralAmount: _collateralAmount,
            interestRate: _interestRate,
            durationDays: _durationDays,
            startTime: 0,
            dueDate: 0,
            totalRepayment: totalRepayment,
            amountRepaid: 0,
            status: LoanStatus.PENDING
        });
        
        loans[_loanId] = newLoan;
        borrowerLoans[_borrower].push(_loanId);
        lenderLoans[_lender].push(_loanId);
        
        emit LoanCreated(_loanId, _borrower, _lender, _loanAmount);
    }
    
    /**
     * @notice Borrower deposits collateral to secure the loan
     * @param _loanId Loan identifier
     */
    function depositCollateral(bytes32 _loanId) external nonReentrant {
        Loan storage loan = loans[_loanId];
        require(loan.loanId != bytes32(0), "Loan does not exist");
        require(msg.sender == loan.borrower, "Only borrower can deposit collateral");
        require(loan.status == LoanStatus.PENDING, "Invalid loan status");
        
        // Transfer collateral from borrower to contract
        IERC20(loan.collateralToken).transferFrom(
            msg.sender,
            address(this),
            loan.collateralAmount
        );
        
        loan.status = LoanStatus.COLLATERALIZED;
        
        emit CollateralDeposited(_loanId, msg.sender, loan.collateralAmount);
    }
    
    /**
     * @notice Lender funds the loan after collateral is deposited
     * @param _loanId Loan identifier
     */
    function fundLoan(bytes32 _loanId) external nonReentrant {
        Loan storage loan = loans[_loanId];
        require(loan.loanId != bytes32(0), "Loan does not exist");
        require(msg.sender == loan.lender, "Only lender can fund loan");
        require(loan.status == LoanStatus.COLLATERALIZED, "Collateral not deposited");
        
        // Transfer loan amount from lender to borrower
        IERC20(loan.loanToken).transferFrom(
            msg.sender,
            loan.borrower,
            loan.loanAmount
        );
        
        // Set loan as active
        loan.status = LoanStatus.ACTIVE;
        loan.startTime = block.timestamp;
        loan.dueDate = block.timestamp + (loan.durationDays * 1 days);
        
        emit LoanFunded(_loanId, msg.sender, loan.loanAmount);
    }
    
    /**
     * @notice Borrower makes a repayment (partial or full)
     * @param _loanId Loan identifier
     * @param _amount Amount to repay
     */
    function makeRepayment(bytes32 _loanId, uint256 _amount) external nonReentrant {
        Loan storage loan = loans[_loanId];
        require(loan.loanId != bytes32(0), "Loan does not exist");
        require(msg.sender == loan.borrower, "Only borrower can repay");
        require(loan.status == LoanStatus.ACTIVE, "Loan not active");
        require(_amount > 0, "Amount must be greater than 0");
        
        uint256 remaining = loan.totalRepayment - loan.amountRepaid;
        require(_amount <= remaining, "Amount exceeds remaining balance");
        
        // Transfer repayment from borrower to lender
        IERC20(loan.loanToken).transferFrom(
            msg.sender,
            loan.lender,
            _amount
        );
        
        loan.amountRepaid += _amount;
        
        emit RepaymentMade(_loanId, msg.sender, _amount, remaining - _amount);
        
        // If fully repaid, return collateral
        if (loan.amountRepaid >= loan.totalRepayment) {
            loan.status = LoanStatus.REPAID;
            
            // Return collateral to borrower
            IERC20(loan.collateralToken).transfer(
                loan.borrower,
                loan.collateralAmount
            );
            
            emit LoanRepaid(_loanId, msg.sender);
            emit CollateralReturned(_loanId, msg.sender, loan.collateralAmount);
        }
    }
    
    /**
     * @notice Mark loan as defaulted if past due date
     * @param _loanId Loan identifier
     */
    function markAsDefaulted(bytes32 _loanId) external {
        Loan storage loan = loans[_loanId];
        require(loan.loanId != bytes32(0), "Loan does not exist");
        require(loan.status == LoanStatus.ACTIVE, "Loan not active");
        require(block.timestamp > loan.dueDate, "Loan not past due");
        require(loan.amountRepaid < loan.totalRepayment, "Loan already repaid");
        
        loan.status = LoanStatus.DEFAULTED;
        
        emit LoanDefaulted(_loanId, loan.borrower);
    }
    
    /**
     * @notice Lender claims collateral after default
     * @param _loanId Loan identifier
     */
    function liquidateCollateral(bytes32 _loanId) external nonReentrant {
        Loan storage loan = loans[_loanId];
        require(loan.loanId != bytes32(0), "Loan does not exist");
        require(msg.sender == loan.lender, "Only lender can liquidate");
        require(loan.status == LoanStatus.DEFAULTED, "Loan not defaulted");
        
        loan.status = LoanStatus.LIQUIDATED;
        
        // Transfer collateral to lender
        IERC20(loan.collateralToken).transfer(
            loan.lender,
            loan.collateralAmount
        );
        
        emit CollateralLiquidated(_loanId, msg.sender, loan.collateralAmount);
    }
    
    /**
     * @notice Get loan details
     * @param _loanId Loan identifier
     */
    function getLoan(bytes32 _loanId) external view returns (Loan memory) {
        return loans[_loanId];
    }
    
    /**
     * @notice Get all loans for a borrower
     * @param _borrower Borrower address
     */
    function getBorrowerLoans(address _borrower) external view returns (bytes32[] memory) {
        return borrowerLoans[_borrower];
    }
    
    /**
     * @notice Get all loans for a lender
     * @param _lender Lender address
     */
    function getLenderLoans(address _lender) external view returns (bytes32[] memory) {
        return lenderLoans[_lender];
    }
    
    /**
     * @notice Check if loan is past due
     * @param _loanId Loan identifier
     */
    function isLoanOverdue(bytes32 _loanId) external view returns (bool) {
        Loan memory loan = loans[_loanId];
        return loan.status == LoanStatus.ACTIVE && 
               block.timestamp > loan.dueDate &&
               loan.amountRepaid < loan.totalRepayment;
    }
    
    // ============================================================================
    // CREDIT SCORE INTEGRATION
    // ============================================================================
    
    /**
     * @notice Set DeFiScoreRegistry address
     * @param _registry Registry contract address
     */
    function setScoreRegistry(address _registry) external onlyOwner {
        require(_registry != address(0), "Invalid registry address");
        scoreRegistry = IDeFiScoreRegistry(_registry);
        emit ScoreRegistryUpdated(_registry);
    }
    
    /**
     * @notice Set default credit score threshold
     * @param _threshold New threshold (scaled x1000, 0-900000)
     */
    function setDefaultThreshold(uint256 _threshold) external onlyOwner {
        require(_threshold <= 900000, "Invalid threshold");
        defaultThreshold = _threshold;
        emit DefaultThresholdUpdated(_threshold);
    }
    
    /**
     * @notice Verify borrower has valid credit score proof
     * @param _borrower Borrower address
     */
    function _verifyCreditScore(address _borrower) internal view {
        if (address(scoreRegistry) == address(0)) {
            revert ScoreRegistryNotSet();
        }
        
        // Check if borrower has valid proof
        if (!scoreRegistry.isEligible(_borrower)) {
            revert NoCreditScoreProof();
        }
        
        // Check if proof is still fresh (within 24 hours)
        if (!scoreRegistry.isProofFresh(_borrower)) {
            revert CreditScoreExpired();
        }
        
        // Check if borrower meets threshold
        if (!scoreRegistry.meetsThreshold(_borrower, defaultThreshold)) {
            revert InsufficientCreditScore();
        }
    }
    
    /**
     * @notice Check if borrower is eligible for loan
     * @param _borrower Borrower address
     * @return bool Eligibility status
     */
    function isBorrowerEligible(address _borrower) external view returns (bool) {
        if (address(scoreRegistry) == address(0)) {
            return false;
        }
        
        return scoreRegistry.isEligible(_borrower) &&
               scoreRegistry.isProofFresh(_borrower) &&
               scoreRegistry.meetsThreshold(_borrower, defaultThreshold);
    }
}

contracts/SecurityGuard.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

/**
 * @title SecurityGuard
 * @notice Advanced security layer for ZK proof system
 * @dev Implements front-running protection, rate limiting, and anomaly detection
 * 
 * Security Features:
 * - Commit-reveal scheme for proof submission
 * - Rate limiting per address
 * - Anomaly detection for suspicious patterns
 * - Emergency circuit breaker
 * - Proof replay prevention (enhanced)
 * - Stale proof control
 * 
 * Architecture:
 * - Works alongside DeFiScoreRegistry
 * - Provides additional security checks
 * - Can be upgraded independently
 */
contract SecurityGuard {
    
    // ============================================================================
    // STATE VARIABLES
    // ============================================================================
    
    /// @notice Owner address
    address public owner;
    
    /// @notice Emergency pause status
    bool public paused;
    
    /// @notice Rate limit: max proofs per address per day
    uint256 public maxProofsPerDay = 5;
    
    /// @notice Rate limit window (24 hours)
    uint256 public constant RATE_LIMIT_WINDOW = 24 hours;
    
    /// @notice Commit-reveal timeout (5 minutes)
    uint256 public constant COMMIT_TIMEOUT = 5 minutes;
    
    /// @notice Minimum time between proofs (1 hour)
    uint256 public constant MIN_PROOF_INTERVAL = 1 hours;
    
    // ============================================================================
    // STRUCTS
    // ============================================================================
    
    struct ProofCommit {
        bytes32 commitHash;
        uint256 timestamp;
        bool revealed;
    }
    
    struct RateLimitData {
        uint256 proofCount;
        uint256 windowStart;
        uint256 lastProofTime;
    }
    
    struct AnomalyScore {
        uint256 suspiciousAttempts;
        uint256 lastFlagTime;
        bool blacklisted;
    }
    
    // ============================================================================
    // STORAGE
    // ============================================================================
    
    /// @notice User => Commit data
    mapping(address => ProofCommit) public commits;
    
    /// @notice User => Rate limit data
    mapping(address => RateLimitData) public rateLimits;
    
    /// @notice User => Anomaly score
    mapping(address => AnomalyScore) public anomalyScores;
    
    /// @notice Nullifier => Block number (enhanced replay prevention)
    mapping(bytes32 => uint256) public nullifierBlocks;
    
    /// @notice Whitelisted addresses (bypass rate limits)
    mapping(address => bool) public whitelist;
    
    // ============================================================================
    // EVENTS
    // ============================================================================
    
    event ProofCommitted(address indexed user, bytes32 commitHash);
    event ProofRevealed(address indexed user, bytes32 nullifier);
    event RateLimitHit(address indexed user, uint256 attempts);
    event AnomalyDetected(address indexed user, string reason);
    event AddressBlacklisted(address indexed user);
    event AddressWhitelisted(address indexed user);
    event PauseToggled(bool paused);
    event RateLimitUpdated(uint256 newLimit);
    
    // ============================================================================
    // ERRORS
    // ============================================================================
    
    error Unauthorized();
    error SystemPaused();
    error RateLimitExceeded();
    error ProofTooFrequent();
    error InvalidCommit();
    error CommitNotFound();
    error CommitExpired();
    error AlreadyRevealed();
    error Blacklisted();
    error NullifierReused();
    
    // ============================================================================
    // MODIFIERS
    // ============================================================================
    
    modifier onlyOwner() {
        if (msg.sender != owner) revert Unauthorized();
        _;
    }
    
    modifier whenNotPaused() {
        if (paused) revert SystemPaused();
        _;
    }
    
    modifier notBlacklisted() {
        if (anomalyScores[msg.sender].blacklisted) revert Blacklisted();
        _;
    }
    
    // ============================================================================
    // CONSTRUCTOR
    // ============================================================================
    
    constructor() {
        owner = msg.sender;
    }
    
    // ============================================================================
    // COMMIT-REVEAL FUNCTIONS
    // ============================================================================
    
    /**
     * @notice Commit to proof submission (step 1)
     * @param _commitHash Hash of (proof + publicSignals + salt)
     * 
     * Front-running protection:
     * - User commits hash first
     * - Reveals actual proof in next transaction
     * - Prevents MEV bots from copying proof
     */
    function commitProof(bytes32 _commitHash) 
        external 
        whenNotPaused 
        notBlacklisted 
    {
        // Check rate limits
        _checkRateLimit(msg.sender);
        
        // Check minimum interval
        RateLimitData storage rateData = rateLimits[msg.sender];
        if (block.timestamp < rateData.lastProofTime + MIN_PROOF_INTERVAL) {
            revert ProofTooFrequent();
        }
        
        // Store commit
        commits[msg.sender] = ProofCommit({
            commitHash: _commitHash,
            timestamp: block.timestamp,
            revealed: false
        });
        
        emit ProofCommitted(msg.sender, _commitHash);
    }
    
    /**
     * @notice Reveal proof (step 2)
     * @param _proof Proof data
     * @param _publicSignals Public signals
     * @param _salt Random salt used in commit
     * @return bool Success status
     */
    function revealProof(
        bytes memory _proof,
        uint256[] memory _publicSignals,
        bytes32 _salt
    ) external whenNotPaused notBlacklisted returns (bool) {
        ProofCommit storage commit = commits[msg.sender];
        
        // Validate commit exists
        if (commit.commitHash == bytes32(0)) revert CommitNotFound();
        if (commit.revealed) revert AlreadyRevealed();
        
        // Check timeout
        if (block.timestamp > commit.timestamp + COMMIT_TIMEOUT) {
            revert CommitExpired();
        }
        
        // Verify commit matches reveal
        bytes32 revealHash = keccak256(abi.encodePacked(_proof, _publicSignals, _salt));
        if (revealHash != commit.commitHash) revert InvalidCommit();
        
        // Extract nullifier from public signals (index 9)
        require(_publicSignals.length >= 10, "Invalid public signals");
        bytes32 nullifier = bytes32(_publicSignals[9]);
        
        // Check nullifier not reused
        if (nullifierBlocks[nullifier] != 0) revert NullifierReused();
        
        // Mark as revealed
        commit.revealed = true;
        nullifierBlocks[nullifier] = block.number;
        
        // Update rate limit
        _updateRateLimit(msg.sender);
        
        emit ProofRevealed(msg.sender, nullifier);
        
        return true;
    }
    
    // ============================================================================
    // RATE LIMITING
    // ============================================================================
    
    /**
     * @notice Check if user exceeds rate limit
     * @param _user User address
     */
    function _checkRateLimit(address _user) internal view {
        // Whitelist bypass
        if (whitelist[_user]) return;
        
        RateLimitData storage data = rateLimits[_user];
        
        // Check if in same window
        if (block.timestamp < data.windowStart + RATE_LIMIT_WINDOW) {
            if (data.proofCount >= maxProofsPerDay) {
                revert RateLimitExceeded();
            }
        }
    }
    
    /**
     * @notice Update rate limit counter
     * @param _user User address
     */
    function _updateRateLimit(address _user) internal {
        RateLimitData storage data = rateLimits[_user];
        
        // Reset window if expired
        if (block.timestamp >= data.windowStart + RATE_LIMIT_WINDOW) {
            data.windowStart = block.timestamp;
            data.proofCount = 1;
        } else {
            data.proofCount++;
        }
        
        data.lastProofTime = block.timestamp;
        
        // Anomaly detection: too many proofs
        if (data.proofCount >= maxProofsPerDay) {
            _flagAnomaly(_user, "Rate limit reached");
        }
    }
    
    // ============================================================================
    // ANOMALY DETECTION
    // ============================================================================
    
    /**
     * @notice Flag suspicious activity
     * @param _user User address
     * @param _reason Reason for flag
     */
    function _flagAnomaly(address _user, string memory _reason) internal {
        AnomalyScore storage score = anomalyScores[_user];
        
        score.suspiciousAttempts++;
        score.lastFlagTime = block.timestamp;
        
        emit AnomalyDetected(_user, _reason);
        
        // Auto-blacklist after 10 flags
        if (score.suspiciousAttempts >= 10) {
            score.blacklisted = true;
            emit AddressBlacklisted(_user);
        }
    }
    
    /**
     * @notice Check for stale proof (external call)
     * @param _timestamp Proof timestamp
     * @param _maxAge Maximum allowed age in seconds
     * @return bool Whether proof is fresh
     */
    function isProofFresh(uint256 _timestamp, uint256 _maxAge) 
        external 
        view 
        returns (bool) 
    {
        return block.timestamp <= _timestamp + _maxAge;
    }
    
    /**
     * @notice Check if nullifier was used in recent blocks
     * @param _nullifier Nullifier to check
     * @param _blockRange Number of blocks to check
     * @return bool Whether nullifier is recent
     */
    function isNullifierRecent(bytes32 _nullifier, uint256 _blockRange) 
        external 
        view 
        returns (bool) 
    {
        uint256 usedBlock = nullifierBlocks[_nullifier];
        if (usedBlock == 0) return false;
        
        return block.number <= usedBlock + _blockRange;
    }
    
    // ============================================================================
    // ADMIN FUNCTIONS
    // ============================================================================
    
    /**
     * @notice Toggle emergency pause
     */
    function togglePause() external onlyOwner {
        paused = !paused;
        emit PauseToggled(paused);
    }
    
    /**
     * @notice Update rate limit
     * @param _newLimit New max proofs per day
     */
    function setRateLimit(uint256 _newLimit) external onlyOwner {
        require(_newLimit > 0 && _newLimit <= 100, "Invalid limit");
        maxProofsPerDay = _newLimit;
        emit RateLimitUpdated(_newLimit);
    }
    
    /**
     * @notice Whitelist address (bypass rate limits)
     * @param _user User address
     */
    function addToWhitelist(address _user) external onlyOwner {
        whitelist[_user] = true;
        emit AddressWhitelisted(_user);
    }
    
    /**
     * @notice Remove from whitelist
     * @param _user User address
     */
    function removeFromWhitelist(address _user) external onlyOwner {
        whitelist[_user] = false;
    }
    
    /**
     * @notice Blacklist address manually
     * @param _user User address
     */
    function blacklistAddress(address _user) external onlyOwner {
        anomalyScores[_user].blacklisted = true;
        emit AddressBlacklisted(_user);
    }
    
    /**
     * @notice Remove from blacklist
     * @param _user User address
     */
    function removeFromBlacklist(address _user) external onlyOwner {
        anomalyScores[_user].blacklisted = false;
        anomalyScores[_user].suspiciousAttempts = 0;
    }
    
    /**
     * @notice Transfer ownership
     * @param _newOwner New owner address
     */
    function transferOwnership(address _newOwner) external onlyOwner {
        require(_newOwner != address(0), "Invalid address");
        owner = _newOwner;
    }
    
    // ============================================================================
    // VIEW FUNCTIONS
    // ============================================================================
    
    /**
     * @notice Get rate limit status for user
     * @param _user User address
     */
    function getRateLimitStatus(address _user) external view returns (
        uint256 proofCount,
        uint256 windowStart,
        uint256 lastProofTime,
        uint256 remainingProofs
    ) {
        RateLimitData storage data = rateLimits[_user];
        
        uint256 remaining = 0;
        if (block.timestamp < data.windowStart + RATE_LIMIT_WINDOW) {
            if (data.proofCount < maxProofsPerDay) {
                remaining = maxProofsPerDay - data.proofCount;
            }
        } else {
            remaining = maxProofsPerDay;
        }
        
        return (
            data.proofCount,
            data.windowStart,
            data.lastProofTime,
            remaining
        );
    }
    
    /**
     * @notice Get anomaly score for user
     * @param _user User address
     */
    function getAnomalyScore(address _user) external view returns (
        uint256 suspiciousAttempts,
        uint256 lastFlagTime,
        bool blacklisted
    ) {
        AnomalyScore storage score = anomalyScores[_user];
        return (
            score.suspiciousAttempts,
            score.lastFlagTime,
            score.blacklisted
        );
    }
    
    /**
     * @notice Check if user can submit proof
     * @param _user User address
     */
    function canSubmitProof(address _user) external view returns (bool) {
        // Check blacklist
        if (anomalyScores[_user].blacklisted) return false;
        
        // Check pause
        if (paused) return false;
        
        // Check rate limit
        if (!whitelist[_user]) {
            RateLimitData storage data = rateLimits[_user];
            if (block.timestamp < data.windowStart + RATE_LIMIT_WINDOW) {
                if (data.proofCount >= maxProofsPerDay) return false;
            }
            
            // Check minimum interval
            if (block.timestamp < data.lastProofTime + MIN_PROOF_INTERVAL) {
                return false;
            }
        }
        
        return true;
    }
}

